const qr = require('qr-image');
const fs = require('fs');
const path = require('path');

const b64Deno = '';

const parts = b64Deno.match(/[\s\S]{1,1024}/g) || [];

console.log(parts.length);

parts.forEach((part, index) => {
    let qrImage = qr.image(part, { type: 'png' });
    qrImage.pipe(fs.createWriteStream(`${path.resolve('./qrcodes')}/deno_code_qr_${index}.png`));
});